import { useState } from "react";

const List = (props) => {
  const [text, setText] = useState("완료");
  const changeText = () => setText("취소");
  return (
    <div>
      <div>{props.list.title}</div>
      <div>{props.list.todo}</div>
      <button
        onClick={() => {
          console.log("삭제");
          props.delete(props.list.id);
        }}
      >
        삭제하기
      </button>
      <button
        onClick={() => {
          props.done(props.list.id);
        }}
        text={text}
        changevalue={changeText}
      >
        완료
      </button>
    </div>
  );
};

export default List;
